import { StyleSheet } from 'react-native';

import colors from '../../config/colors';

const styles = StyleSheet.create({
  square: {
    height: 35,
    backgroundColor: colors.primary,
    borderWidth: 2,
    borderColor: colors.primary,
  },
});

export default styles;
